document.addEventListener("DOMContentLoaded", () => {
  createCanvas(badgeImage);
});

var canvas = document.createElement("canvas"),
  ctx = canvas.getContext("2d");

function setLast(value) {
  if (value.length > 1) {
    value = value.substr(0, 1);
  }
  const frst = document.querySelector("#first-name");
  setFirst(frst.value + " " + value + "");
}

function showHelp(value) {
  if (value.length) {
    const txt = document.querySelector(".muted-text");
    txt.innerHTML = 'Press "ENTER" to see your badge';
  }
}

function printBadge() {
  const img = document.querySelector(".badge-form");
  img.classList.add("printing");
  setTimeout(function() {
    window.print();
  }, 888);
}

function setFirst(value) {
  const rex = /[a-zA-Z]+\s{1}[a-zA-Z]{1}$/.exec(value);
  const btn = document.querySelector("button");
  const txt = document.querySelector(".muted-text");
  if (rex) {
    const img = document.querySelector("#badge-image");
    ctx.fillStyle = "#FFFFFF";
    ctx.fillRect(20, 290, 750, 90);
    ctx.font = "100px Arial";
    ctx.fillStyle = "#ba168b";
    ctx.fillText(value, 50, 360);
    img.src = canvas.toDataURL();
    btn.disabled = false;
    txt.innerHTML = 'Click "Print" to export your new badge!';
    txt.style.color = "green";
    return;
  }
  btn.disabled = true;
  txt.innerHTML = "Enter ONLY first name and last initial!";
  txt.style.color = "red";
}

function createCanvas(src) {
  var im = new Image();
  const img = document.querySelector("#badge-image");
  im.onload = function() {
    canvas.width = im.width;
    canvas.height = im.height;
    ctx.drawImage(im, 0, 0);
    ctx.font = "60px Arial";
    ctx.fillStyle = "#FFFFFF";
    ctx.fillRect(20, 300, 750, 80);
    ctx.fillStyle = "#999999";
    ctx.fillText("Enter First Name + Initial", 50, 360);
    img.src = canvas.toDataURL();
  };
  im.src = src;
}

var badgeImage =
  "data:image/png;base64,";
